#First_programm

import pyowm
from tkinter import *
import random


root = Tk()
root.title("Определитель погоды")              #Титул программы и размеры
root.geometry("700x500+300+250")
root.resizable(width=False, height=False) #Возможность менять размер окна




def harackter():
	owm = pyowm.OWM('24ee316d05bdc2ba0488d888ac3546a5')             #Просто pyowm (Если что-то не понятно то в гивхаб)
	mgr = owm.weather_manager()

	p = pField.get()

	observation = mgr.weather_at_place(p)
	w = observation.weather





	text2.insert(END, "В городе " + p + " сейчас " + str(w.detailed_status) + "\n") 
	text.insert(END, "clear sky = чистое небо" + "\n" + 
	"clouds = облачно" + "\n" + 
	"broken clouds = тучи" + "\n" +                                             
	"few clouds = небольшие облака" + "\n" +           #Просто будет вписыватся  после нажатия на кнопку                        
	"scattered clouds = рассеянные облака" + "\n" + 
	"overcast clouds = небольшое количество облаков" + "\n" +
	"light snow = легкий снежок" + "\n" +
	"snow = снег" + "\n\n" + 
	"~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~" + "\n\n")




	t = 'Температура на данный момент = ' + str(w.temperature('celsius')["temp"]) + " градусам по цельсию" + "\n"
	t2 = 'Максимальная температура за день = ' + str(w.temperature('celsius')["temp_max"]) + " градусам по цельсию" + '\n'
	t3 = 'Минимальная температура за день = ' + str(w.temperature('celsius')["temp_min"]) + " градусам по цельсию" + '\n'
	we = 'Скорость ветра = ' + str(w.wind()) + '\n'
	ob = "Количество облаков = " + str(w.clouds) + '\n'     
	ti = "Тепловой индекс = " + str(w.heat_index) + '\n'
	v = "Влажность = " + str(w.humidity) + '\n'
	rain = "Дождь = " + str(w.rain) + '\n\n'






	text.insert(END, t)
	text.insert(END, t2)
	text.insert(END, t3)
	text.insert(END, we)                              #характеристика и вывод на экран погоды
	text.insert(END, ob)
	text.insert(END, ti)
	text.insert(END, v)
	text.insert(END, rain)

	

	

def close():
	raise SystemExit



def clean():
    text.delete(1.0, END)
    text2.delete(1.0, END)








but1 = ""
but2 = ""
but3 = ""

button1 = PhotoImage(data=but1)
button2 = PhotoImage(data=but2)             #Добавление иконок
button3 = PhotoImage(data=but3)



opr = Button(
	text="Определить", 
	font = 10, bg="#0fff83",                #Кнопка определения погода
	fg="#000000", width=15, 
	height = 3,                   
	command=harackter,
	relief=GROOVE
	)


exit = Button(
	text="Выйти", 
	font = 10, 
	bg="#f80000", 
	fg="#000000",             #Кнопка Выхода
	width=15, 
	height = 3, 
	command=close,
	relief=GROOVE
	)



clear = Button(text="Очистить",
	font = 10, bg='#2929ff',
	fg="#000000", 
	width=15,                           #Кнопка очищения
	height = 3,
	relief=GROOVE,
	command=clean
	)


clear.place(x=250, y=350)
opr.place(x=50, y=350)
exit.place(x=450, y=350)          




text = Text(
	width=70, 
	height=12, 
	bg="#ed8218", 
	fg='#991400',          #Большое поле текста
	wrap=WORD, 
	font="Arial 12"
	)



text2 = Text(
	width=55,
	height=2,
	bg="#ed8218", 
	fg='#991400', 			#Маленькое поле текста
	wrap=WORD, 
	font="Arial 12",
	)


text2.place(x=100, y=275)
text.place(x=20, y=20)




